import React from "react";
import { home } from "../data/datas";


export const Home = () => {
  return (
    <section className="home">
      <div className="container">
        {home.map((val, index) => (
          <div key={index} className="text">
            <h3>{val.text}</h3>
            <h1>{val.name}</h1>
            <h2>{val.post}</h2>
            <h4>{val.design}</h4>
            <p>{val.desc}</p>
          </div>
        ))}
      </div>
    </section>
  );
};
